import React from 'react';
import pic01 from '../images/room1.jpeg'
import pic02 from '../images/room2.webp'
import pic03 from '../images/room3.webp'
import './Slider.css'; // Create a CSS file for styling if needed


const Feature = (pic, address, price, description) => {
  return (
    // <div className={`feature ${isVisible ? 'visible' : 'hidden'}`}>

      <div className="col-4 col-12-medium" style={{margin: '20px', animation: "fade 10s alternate infinite"}}>
        <section className="box feature">
          {/* Add inline styles to the image tag */}
          <a href="#" className="image featured">
            <img src={pic} alt="" style={{ width: '100px', height: '200px', objectFit: 'cover'}} />
          </a>
          <div className="inner">
            <header>
              <h2> {address} </h2>
              <p>{price}</p>
            </header>
            <p>{description}</p>
          </div>
        </section>
      </div>

    // </div>
  );
};

export default Feature;
